import React from 'react'
import D3Node from '../d3Node/D3Node'

const Input = (props) => {

    const inputHandler = (event) => {
        return (
            <D3Node 
            name={event.value}
        />
        )
    }

    return(
        <div>
             <label class='nameL' for='name'>Name</label>
            <input
                type='text'
                label="Name"
                onInput={inputHandler}
            />
        </div>
    )
}

export default Input
